  [],\n\t\"revision_timestamp\": \"2016-07-27T23:03:47.232936\",\n\t\"name\": \"hunting-plan-at-morgan-brake-national-wildlife-refuge-1979\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"The principal resident game species are
  fox and gray squirrel, white-tailed deer, eastern wild turkey, raccoon, and swamp
  and cottontail rabbit. Furbearing species of the area include beaver, nutria, raccoon,
  muskrat, mink, otter, weasel, spotted and striped skunk, and bobcat. Non-game wildlife
  is also abundant on the refuge with the diversity and interspersion of habitat types
  creating an edge effect beneficial to wildlife. There is a small population of American
  alligators on the refuge; however, there is considerable habitat available for this
  endangered species~ Although neither the southern bald eagle nor the American peregrine
  falcon have been observed in the Morgan Brake area in recent years, both are winter
  migrants of the Yazoo' Basin. Sloughs, streams, beaver impoundments and other refuge
  wetlands provide only a limited amount of fish habitat except during high water
  periods when concentration of fish may be high in suitable areas. Species may include
  any of the fishes common to the Mississippi or Yazoo Rivers.\",\n\t\"license_title\":
